Fare colonne sonore puó sembrare diverso da scrivere canzoni, ma è un testo già scritto in cui dobbiamo stare sempre molto attenti a quali evidenziatori usare. È stato bellissimo per me andare altrove rispetto a dove sono sempre stato musicalmente così come è stato bello lavorare con Milena Cocozza che ha accompagnato in modo libero tutta la musica che c’è in questo film. Grazie a Taketo Gohara e a Leonardo Milani che mi hanno accompagnato in questa produzione. Felice di presentarlo al Torino film festival il 29 Novembre.
